import React from 'react'
import { Fade } from "react-reveal";
import Header from "../../components/header/Header";
import Footer from "../../components/footer/Footer";
import './gallery.css';
function GalleryComponent(props) {
    
    (function(d, s, id)
    {
        var js;
         if (d.getElementById(id)) 
        {
            return;
        }
         js = d.createElement(s);
          js.id = id;
           js.src = "https://embedsocial.com/cdn/ht.js";
            d.getElementsByTagName("head")[0].appendChild(js);
        }(document, "script", "EmbedSocialHashtagScript"));
    return (
        <div style={{width:'100vw'}}>
            {React.useEffect(()=>{
        props.setAnime(false)
    },[])}
            <Header theme={props.theme} setTheme={props.setTheme} />
      <Fade bottom distance="40px">
      <div style={{width:'100vw'}}>
      <div class="embedsocial-hashtag" data-ref="320372bec4b82686b50fffc8cc187d45951601be" >
                <a class="feed-powered-by-es helloWorld" href="https://embedsocial.com/social-media-aggregator/" style={{display:'none'}} target="_blank" >
                    </a>
                    </div>
                    <script>();
                    </script>
        </div>
        </Fade>
        <Footer theme={props.theme} />
        </div>
    )
}

export default GalleryComponent
